description:
A collection of episodes from the second season of the Sekirei anime, entitled &quot;Sekirei: Pure Engagement.&quot; Apparently, the second season of Sekirei is rare to find in its uncensored form, but after scouring around the internet, I've finally found it and have decided to share it with all you wonderful folks.

Enjoy!

